const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "tablex"
    }}>{`Tablex`}</h1>
    <p>{`基于`}<a href="https://github.com/bvaughn/react-window">{`react-window`}</a>{`的表格组件`}</p>
    <h2 {...{
      "id": "特性"
    }}>{`特性`}</h2>
    <blockquote>
      <p parentName="blockquote">{`1.大数据量虚拟加载
2.自适应宽、高
3.仿antd table样式
4.兼容ant table api
5.支持树形数据`}</p>
    </blockquote>
    <h2 {...{
      "id": "roadmap"
    }}>{`Roadmap`}</h2>
    <blockquote>
      <p parentName="blockquote">{`1.更好的列冻结
2.拖动列宽
3.分页
4.列排序
5.列分组
6.列排序
7.表格属性设置
8.自动记忆表格配置
9.表格编辑`}</p>
    </blockquote>
    </MDXLayout>;
}

